import React from "react"
import { Navigate, Route, Routes } from "react-router-dom"
import { routes } from "../router/routes"


const AppRouter = () => {
    return(
        <Routes>
        {routes.map(route => 
            <Route 
            path={route.path}
            element={route.element()}
            exact={route.exact}
            key={route.id}
             />
        )}
        <Route path="*" element={<Navigate to ="/Main" />}/>
      </Routes>
    )
}

export default AppRouter
